def is_prime(num):
    if num <= 1:
        return False
    if num <= 3:
        return True
    if num % 2 == 0 or num % 3 == 0:
        return False
    i = 5
    while i * i <= num:
        if num % i == 0 or num % (i + 2) == 0:
            return False
        i += 6
    return True

def count_sabotages_at_level_5(N):
    count = 0
    p = 2
    while p**4 <= N:
        if is_prime(p):
            count += 1
        p += 1
    return count

def main():
    import sys
    input = sys.stdin.read
    data = input().split()

    T = int(data[0])
    results = []
    for i in range(1, T + 1):
        N = int(data[i])
        result = count_sabotages_at_level_5(N)
        results.append(result)

    for res in results:
        print(res)

main()

